  \"farallon-national-wildlife-refuge-final-comprehensive-conservation-plan-and-environmental-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Farallon NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Farallon NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, a summary of Refuge Resources, information
  about the management direction, current management programs, and strategies for
  implementation. Key planning issues include: wildlife management, habitat management,
  environmental education, and public use.\",\n\t\"license_title\": \"License Not
